import React , {Component} from 'react'

class TrTable extends Component {
    render(){
        return(

            <tr>
                <th scope="row">1</th>
                <td>Mark</td>
                <td>Otto</td>
                <td>@mdo</td>
            </tr>
        )
    }
}
export default TrTable
